import { Router, Route, Switch, Link, NavLink } from "react-router-dom";
import Start from "../Start";

// export const history = createHistory();

const AppRouter = () => (
  <Router>
    <Switch>
      <Route path="/" component={Start} />
      {/* <Start /> */}
      <Route path="/App" component={App} />
    </Switch>
  </Router>
);

export default AppRouter;
